import React from "react";
import { Movie } from "../Movie/Movie";
import { Preloader } from "../Preloader/Preloader";
import { Search } from "../Search/Search";
import "./Movies.css";

const Movies = (props) => {
  const { movies, searchMovie, changeBg } = props;
  console.log(movies);
  return (
    <React.Fragment>
      <Search searchMovie={searchMovie} />
      {movies.map((movie) => {
        console.log(movie);
        return (
          <Movie
            changeBg={() => {
              changeBg(movie.imdbID);
            }}
            poster={movie.Poster}
            title={movie.Title}
            type={movie.Type}
          />
        );
      })}
    </React.Fragment>
  );
};

export { Movies };
